import React from 'react';
import Mo from './Main.module.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faMagnifyingGlass } from '@fortawesome/free-solid-svg-icons';
import Logo11 from './Components/Images/logo11.png';

function Main() {
  return (
    <div className={Mo.main1}>
      <div className={Mo.inputContainer}>
      <FontAwesomeIcon icon={faMagnifyingGlass} className={Mo.icn2}/>
        <input type='text' className={Mo.inp1} placeholder='Search ToDo task here.' />
      </div>
      <div className={Mo.imgm}>
        <img src={Logo11} className={Mo.img11}/>
        <h3>Organize your time for<br/>more productive work.<br/>Try to achieve your goals<br/>on time by managing via pu</h3>
      </div>
    </div>
  )
}

export default Main;
